                    "text": "Year of Completion:\r\nProvide the year in which the creation of this work was completed. If there are multiple versions of this work, provide the year of completion for the particular version being submitted for registration. The year of completion should not refer to earlier or later versions of this work.",
                    "type": "control_text"
                }, {
                    "name": "ltpgtltstronggtltspanStylefontsize205",
                    "qid": "205",
                    "text": "Date of First Publication:\r\nProvide the month, day, and year the work was first published in any country. If you do not know the exact date of first publication, give the approximate month, day, and year. If the work is not published yet, enter today's date.\r\nPublication is the distribution of copies of a work to the public by sale or other transfer of ownership, or by rental, lease, or lending. The offering to distribute copies or phonorecords to a group of persons for purposes of further distribution, public performance, or public display also constitutes publication. A public performance or display of a work does not of itself constitute publication.\r\nTo help youdetermine whether the work has been published or is unpublishedconsider whether you have sold or licensed your work to be sold or distributed to the public. If you have never performed or displayed your work for monetary compensation it is considered unpublished.",
