                    "name": "input241",
                    "qid": "241",
                    "text": "Literary Works DefinitionA literary work is a work that explains, describes, or narrates a particular subject, theme, or idea through the use of narrative, descriptive, or explanatory text, rather than dialog or dramatic action. Generally, literary works are intended to be read; they are not intended to be performed before an audience.\r\nStatutory DefinitionThe Copyright Act defines literary works as works, other than audiovisual works, expressed in words, numbers, or other verbal or numerical symbols or indicia, regardless of the nature of the material objects, such as books, periodicals, manuscripts, phonorecords, film, tapes, disks, or cards, in which they are embodied. (17 U.S.C.  101)\r\nCommon Type Of Works Registered In This Category\r\n\r\nAdvertising and Marketing Materials\r\nAnthologies\r\nArticles\r\nAutobiographies \u002F Memoirs\r\nBlogs\r\nBoard Games and Card Games\r\nBook (Fiction \u002F Non-Fiction)\r\nCatalogs\r\nCookbooks\r\nCraft Books\r\nDictionaries\r\nDissertations\r\nDirectories\r\nEducational Workbooks\r\nFiction\r\nGenealogies\r\nHistorical Works\r\nHow-To Books\r\nInstructions\r\nInterviews\r\nMagazines\r\nManuscripts\r\nMedical & Legal Publications\r\nNewsletters\r\nNewspapers\r\nPeriodicals\r\nPoems\r\nReference Works\r\nResearch Papers\r\nSerial Publications\r\nShort Stories\r\nTests\r\nText Only\r\nText w\u002FArtwork included\r\nTextbooks\r\nTranslations\r\nUser Manuals\r\n",
                    "type": "control_text"
                }, {
                    "name": "ltpgtltstronggtliteraryWorks",
                    "qid": "242",
                    "text": "Visual Arts DefinitionWorks of the visual arts include a wide variety of pictorial, graphic, and sculptural works, as well as architectural works. Examples of visual arts works include paintings, sculptures, photographs, and other types of works.\r\nStatutory DefinitionsPictorial, Graphic and Sculptural WorksThe Copyright Act states that pictorial, graphic, and sculptural works include two-dimensional and three-dimensional works of fine, graphic, and applied art, photographs, prints and art reproductions, maps, globes, charts, diagrams, models, and technical drawings, including architectural plans. (17 U.S.C.  101)\r\nArchitectural WorksThe Copyright Act defines Architectural Works as the design of a building as embodied in any tangible medium of expression, including a building, architectural plans, or drawings. The work includes the overall form as well as the arrangement and composition of spaces and elements in the design, but does not include individual standard features. (17 U.S.C.  101)\r\nCommon Type Of Works Registered In This Category\r\n\r\nAdvertisements (visual \u002F photograpy)\r\nArchitectural Works\r\nArtwork (2D, 3D)\r\nBlueprints\r\nBoard Games (visual aspects)\r\nBuildings\r\nCarpeting\r\nCartography (maps \u002F globes)\r\nCartoons, Comic Strips, Comic Books\r\nCatalogs (visual aspects)\r\nCraft Kits\r\nDrawings\r\nFabric Designs\r\nFlooring Designs\r\nGeologic Charts\r\nGraphic Designs\r\nGreeting Cards\r\nIllustrations\r\nJewelry Designs\r\nLabels (visual aspects)\r\nLogos\r\nMaps\r\nMasks\r\nModels\r\nPaintings\r\nPhotographs (GRUPH\u002FGRPPH)\r\nPostersPrints \u002F Reproductions\r\nProduct Packaging\r\nPuppets\r\nScientific\r\nDrawings\r\nSculptures\r\nStationery\r\nStencils\r\nTechnical Drawings\r\nTextile Designs\r\nToys\r\nVessel Hulls\r\nWallpaper\r\nWebsites\r\nWrapping Paper\r\n",
                    "type": "control_text"
                }, {
                    "name": "ltpgtltstronggtliteraryWorks243",
                    "qid": "243",
                    "text": "Performing Arts DefinitionWorks of the performing arts are works that are intended to be performed for an audience. This category includes a wide variety of creative works, includingmusic,lyrics,sound recordings, scripts, screenplays,choreography,motion pictures,video games, and similar types of works.\r\nStatutory DefinitionThe Copyright Act states that performing a work means to recite, render, play, dance, or act it, either directly or by means of any device or process or, in the case of a motion picture or other audiovisual work, to show its images in any sequence or to make the sounds accompanying it audible. (17 U.S.C.  101)\r\nCommon Type Of Works Registered In This Category\r\n\r\nAlbums\r\nAudio Books\r\nBeats\r\nChoreographic Works\r\nComedy Routines \u002F Stand Up Routines\r\nDramatic Works\r\nInterviews\r\nJingles\r\nLive Concerts\r\nLyrics\r\nMethod \u002F Musical Instruction Books\r\nMusic\r\nMusic & Lyrics\r\nMusic Editing\r\nMusical Arrangement\r\nMusical Theater\r\nMusicals (Song \u002F Script)\r\nPantomime\r\nPodcasts\r\nRemixes\r\nScreenplays\r\nScripts\r\nSongs\r\nSound Recordings\r\nSoundtracks\r\nSpoken Word Recordings\r\nStage Plays\r\nSynopses\r\nTeleplays\r\nTreatments\r\n",
                    "type": "control_text"
                }, {
                    "name": "ltpgtltstronggtliteraryWorks244",
                    "qid": "244",
                    "text": "Motion Pictures DefinitionMotion Pictures are works that contain a series of related images that are intended to be shown with a projector, digital display, or other device. When the images are shown in successive order, they create an impression of movement that is perceptible to the eye. Examples of motion pictures include movies, television shows, video games, animations, and similar types of works.\r\nStatutory DefinitionsMotion PicturesThe Copyright Act defines motion pictures as audiovisual works consisting of a series of related images which, when shown in succession, impart an impression of motion, together with accompanying sounds, if any. 17 U.S.C.  101\r\nAudiovisual WorksThe Copyright Act defines audiovisual works as works that consist of a series of related images which are intrinsically intended to be shown by the use of machines or devices such as projectors, viewers, or electronic equipment, together with accompanying sounds, if any, regardless of the nature of the material objects, such as films or tapes, in which the works are embodied. (17 U.S.C.  101)\r\nCommon Type Of Works Registered In This Category\r\n\r\nAnimations\r\nAudiovisual Works\r\nTelevision Commercials\r\nConcert Videos\r\nDocumentaries\r\nMotion Pictures\r\nMultimedia Works\r\nMusic Videos\r\nPowerpoints\r\nSlide Presentations\r\nSporting events (videos)\r\nTelevision Shows\r\nVideogames\r\n",
                    "type": "control_text"
                }, {
                    "name": "ltpgtltstronggtliteraryWorks245",
                    "qid": "245",
                    "text": "Digital Content DefinitionThe Copyright Act protects a wide variety of works that are used with computers, tablets, smartphones, videogame platforms, and other electronic devices. It also protects works that are used or distributed on the internet, such as websites, blogs, and other online content.\r\nCommon Type Of Works Registered In This Category\r\n\r\nApps\r\nBlogs\r\nComputer Programs\r\nDatabases\r\nMask Works\r\nScreen Displays\r\nSocial Media Posts\r\nSpreadsheets\r\nVideo Games\r\nWebsites\r\n",
                    "type": "control_text"
                }, {
                    "name": "ltpgtltstronggtliteraryWorks246",
                    "qid": "246",
                    "text": "Photographs DefinitionThe Copyright Act protects a wide variety ofphotographic works. This category includes photographs that are created with a camera and captured in a digital file or other visual medium such as film. Examples include color photos, black and white photos, and similar types of images.\r\nCommon Type Of Works Registered In This Category\r\n\r\nCommercial Photos\r\nDocumentary Photos\r\nEditorial Photos\r\nEvents Photos\r\nFine Arts Photos\r\nForensic Photos\r\nPersonal Photos\r\nPhotojournalism Photos\r\nPortrait Photos\r\nSchool Photos\r\nSelfie Photos\r\nScientific Photos\r\nSports Photos\r\nWedding Photos\r\n",
