                                <p>
                                    <strong>Literary Works Definition</strong>
                                    <br/>A literary work is a work that explains, describes, or narrates a particular subject, theme, or idea through the use of narrative, descriptive, or explanatory text, rather than dialog or dramatic action. Generally, literary works are intended to be read; they are not intended to be performed before an audience.
                                </p>
                                <p>
                                    <strong>Statutory Definition</strong>
                                    <br/>The Copyright Act defines literary works as works, other than audiovisual works, expressed in words, numbers, or other verbal or numerical symbols or indicia, regardless of the nature of the material objects, such as books, periodicals, manuscripts, phonorecords, film, tapes, disks, or cards, in which they are embodied. (17 U.S.C.  101)
                                </p>
                                <p>
                                    <strong>Common Type Of Works Registered In This Category</strong>
                                </p>
                                <ul style="list-style-type: disc;">
                                    <li>Advertising and Marketing Materials</li>
                                    <li>Anthologies</li>
                                    <li>Articles</li>
                                    <li>Autobiographies / Memoirs</li>
                                    <li>Blogs</li>
                                    <li>Board Games and Card Games</li>
                                    <li>Book (Fiction / Non-Fiction)</li>
                                    <li>Catalogs</li>
                                    <li>Cookbooks</li>
                                    <li>Craft Books</li>
                                    <li>Dictionaries</li>
                                    <li>Dissertations</li>
                                    <li>Directories</li>
                                    <li>Educational Workbooks</li>
                                    <li>Fiction</li>
                                    <li>Genealogies</li>
                                    <li>Historical Works</li>
                                    <li>How-To Books</li>
                                    <li>Instructions</li>
                                    <li>Interviews</li>
                                    <li>Magazines</li>
                                    <li>Manuscripts</li>
                                    <li>Medical &amp;Legal Publications</li>
                                    <li>Newsletters</li>
                                    <li>Newspapers</li>
                                    <li>Periodicals</li>
                                    <li>Poems</li>
                                    <li>Reference Works</li>
                                    <li>Research Papers</li>
                                    <li>Serial Publications</li>
                                    <li>Short Stories</li>
                                    <li>Tests</li>
                                    <li>Text Only</li>
                                    <li>Text w/Artwork included</li>
                                    <li>Textbooks</li>
                                    <li>Translations</li>
                                    <li>User Manuals</li>
                                </ul>
                            </div>
                        </div>
                    </li>
                    <li class="form-line always-hidden form-field-hidden" style="display:none;" data-type="control_text" id="id_243">
                        <div id="cid_243" class="form-input-wide always-hidden" data-layout="full">
                            <div id="text_243" class="form-html" data-component="text" tabindex="0">
                                <p>
                                    <strong>Performing Arts Definition</strong>
                                    <br/>Works of the performing arts are works that are intended to be performed for an audience. This category includes a wide variety of creative works, includingmusic,lyrics,sound recordings, scripts, screenplays,choreography,motion pictures,video games, and similar types of works.
                                </p>
                                <p>
                                    <strong>Statutory Definition</strong>
                                    <br/>The Copyright Act states that performing a work means to recite, render, play, dance, or act it, either directly or by means of any device or process or, in the case of a motion picture or other audiovisual work, to show its images in any sequence or to make the sounds accompanying it audible. (17 U.S.C.  101)
                                </p>
                                <p>
                                    <strong>Common Type Of Works Registered In This Category</strong>
                                </p>
                                <ul style="list-style-type: disc;">
                                    <li>Albums</li>
                                    <li>Audio Books</li>
                                    <li>Beats</li>
                                    <li>Choreographic Works</li>
                                    <li>Comedy Routines / Stand Up Routines</li>
                                    <li>Dramatic Works</li>
                                    <li>Interviews</li>
                                    <li>Jingles</li>
                                    <li>Live Concerts</li>
                                    <li>Lyrics</li>
                                    <li>Method / Musical Instruction Books</li>
                                    <li>Music</li>
                                    <li>Music &amp;Lyrics</li>
                                    <li>Music Editing</li>
                                    <li>Musical Arrangement</li>
                                    <li>Musical Theater</li>
                                    <li>Musicals (Song / Script)</li>
                                    <li>Pantomime</li>
                                    <li>Podcasts</li>
                                    <li>Remixes</li>
                                    <li>Screenplays</li>
                                    <li>Scripts</li>
                                    <li>Songs</li>
                                    <li>Sound Recordings</li>
                                    <li>Soundtracks</li>
                                    <li>Spoken Word Recordings</li>
                                    <li>Stage Plays</li>
                                    <li>Synopses</li>
                                    <li>Teleplays</li>
                                    <li>Treatments</li>
                                </ul>
                            </div>
                        </div>
                    </li>
                    <li class="form-line always-hidden form-field-hidden" style="display:none;" data-type="control_text" id="id_242">
                        <div id="cid_242" class="form-input-wide always-hidden" data-layout="full">
                            <div id="text_242" class="form-html" data-component="text" tabindex="0">
                                <p>
                                    <strong>Visual Arts Definition</strong>
                                    <br/>Works of the visual arts include a wide variety of pictorial, graphic, and sculptural works, as well as architectural works. Examples of visual arts works include paintings, sculptures, photographs, and other types of works.
                                </p>
                                <p>
                                    <strong>Statutory Definitions</strong>
                                    <br/>
                                    <strong>Pictorial, Graphic and Sculptural Works</strong>
                                    <br/>The Copyright Act states that pictorial, graphic, and sculptural works include two-dimensional and three-dimensional works of fine, graphic, and applied art, photographs, prints and art reproductions, maps, globes, charts, diagrams, models, and technical drawings, including architectural plans. (17 U.S.C.  101)
                                </p>
                                <p>
                                    <strong>Architectural Works</strong>
                                    <br/>The Copyright Act defines Architectural Works as the design of a building as embodied in any tangible medium of expression, including a building, architectural plans, or drawings. The work includes the overall form as well as the arrangement and composition of spaces and elements in the design, but does not include individual standard features. (17 U.S.C.  101)
                                </p>
                                <p>
                                    <strong>Common Type Of Works Registered In This Category</strong>
                                </p>
                                <ul style="list-style-type: disc;">
                                    <li>Advertisements (visual / photograpy)</li>
                                    <li>Architectural Works</li>
                                    <li>Artwork (2D, 3D)</li>
                                    <li>Blueprints</li>
                                    <li>Board Games (visual aspects)</li>
                                    <li>Buildings</li>
                                    <li>Carpeting</li>
                                    <li>Cartography (maps / globes)</li>
                                    <li>Cartoons, Comic Strips, Comic Books</li>
                                    <li>Catalogs (visual aspects)</li>
                                    <li>Craft Kits</li>
                                    <li>Drawings</li>
                                    <li>Fabric Designs</li>
                                    <li>Flooring Designs</li>
                                    <li>Geologic Charts</li>
                                    <li>Graphic Designs</li>
                                    <li>Greeting Cards</li>
                                    <li>Illustrations</li>
                                    <li>Jewelry Designs</li>
                                    <li>Labels (visual aspects)</li>
                                    <li>Logos</li>
                                    <li>Maps</li>
                                    <li>Masks</li>
                                    <li>Models</li>
                                    <li>Paintings</li>
                                    <li>Photographs (GRUPH/GRPPH)</li>
                                    <li>PostersPrints / Reproductions</li>
                                    <li>Product Packaging</li>
                                    <li>Puppets</li>
                                    <li>Scientific</li>
                                    <li>Drawings</li>
                                    <li>Sculptures</li>
                                    <li>Stationery</li>
                                    <li>Stencils</li>
                                    <li>Technical Drawings</li>
                                    <li>Textile Designs</li>
                                    <li>Toys</li>
                                    <li>Vessel Hulls</li>
                                    <li>Wallpaper</li>
                                    <li>Websites</li>
                                    <li>Wrapping Paper</li>
                                </ul>
                            </div>
                        </div>
                    </li>
                    <li class="form-line always-hidden form-field-hidden" style="display:none;" data-type="control_text" id="id_244">
                        <div id="cid_244" class="form-input-wide always-hidden" data-layout="full">
                            <div id="text_244" class="form-html" data-component="text" tabindex="0">
                                <p>
                                    <strong>Motion Pictures Definition</strong>
                                    <br/>Motion Pictures are works that contain a series of related images that are intended to be shown with a projector, digital display, or other device. When the images are shown in successive order, they create an impression of movement that is perceptible to the eye. Examples of motion pictures include movies, television shows, video games, animations, and similar types of works.
                                </p>
                                <p>
                                    <strong>Statutory Definitions</strong>
                                    <br/>
                                    Motion Pictures<br/>The Copyright Act defines motion pictures as audiovisual works consisting of a series of related images which, when shown in succession, impart an impression of motion, together with accompanying sounds, if any. 17 U.S.C.  101
                                </p>
                                <p>
                                    <strong>Audiovisual Works</strong>
                                    <br/>The Copyright Act defines audiovisual works as works that consist of a series of related images which are intrinsically intended to be shown by the use of machines or devices such as projectors, viewers, or electronic equipment, together with accompanying sounds, if any, regardless of the nature of the material objects, such as films or tapes, in which the works are embodied. (17 U.S.C.  101)
                                </p>
                                <p>
                                    <strong>Common Type Of Works Registered In This Category</strong>
                                </p>
                                <ul style="list-style-type: disc;">
                                    <li>Animations</li>
                                    <li>Audiovisual Works</li>
                                    <li>Television Commercials</li>
                                    <li>Concert Videos</li>
                                    <li>Documentaries</li>
                                    <li>Motion Pictures</li>
                                    <li>Multimedia Works</li>
                                    <li>Music Videos</li>
                                    <li>Powerpoints</li>
                                    <li>Slide Presentations</li>
                                    <li>Sporting events (videos)</li>
                                    <li>Television Shows</li>
                                    <li>Videogames</li>
                                </ul>
                            </div>
                        </div>
                    </li>
                    <li class="form-line always-hidden form-field-hidden" style="display:none;" data-type="control_text" id="id_245">
                        <div id="cid_245" class="form-input-wide always-hidden" data-layout="full">
                            <div id="text_245" class="form-html" data-component="text" tabindex="0">
                                <p>
                                    <strong>Digital Content Definition</strong>
                                    <br/>The Copyright Act protects a wide variety of works that are used with computers, tablets, smartphones, videogame platforms, and other electronic devices. It also protects works that are used or distributed on the internet, such as websites, blogs, and other online content.
                                </p>
                                <p>
                                    <strong>Common Type Of Works Registered In This Category</strong>
                                </p>
                                <ul style="list-style-type: disc;">
                                    <li>Apps</li>
                                    <li>Blogs</li>
                                    <li>Computer Programs</li>
                                    <li>Databases</li>
                                    <li>Mask Works</li>
                                    <li>Screen Displays</li>
                                    <li>Social Media Posts</li>
                                    <li>Spreadsheets</li>
                                    <li>Video Games</li>
                                    <li>Websites</li>
                                </ul>
                            </div>
                        </div>
                    </li>
                    <li class="form-line always-hidden form-field-hidden" style="display:none;" data-type="control_text" id="id_246">
                        <div id="cid_246" class="form-input-wide always-hidden" data-layout="full">
                            <div id="text_246" class="form-html" data-component="text" tabindex="0">
                                <p>
                                    <strong>Photographs Definition</strong>
                                    <br/>The Copyright Act protects a wide variety ofphotographic works. This category includes photographs that are created with a camera and captured in a digital file or other visual medium such as film. Examples include color photos, black and white photos, and similar types of images.
                                </p>
                                <p>
                                    <strong>Common Type Of Works Registered In This Category</strong>
                                </p>
                                <ul style="list-style-type: disc;">
                                    <li>Commercial Photos</li>
                                    <li>Documentary Photos</li>
                                    <li>Editorial Photos</li>
                                    <li>Events Photos</li>
                                    <li>Fine Arts Photos</li>
                                    <li>Forensic Photos</li>
                                    <li>Personal Photos</li>
                                    <li>Photojournalism Photos</li>
                                    <li>Portrait Photos</li>
                                    <li>School Photos</li>
                                    <li>Selfie Photos</li>
                                    <li>Scientific Photos</li>
                                    <li>Sports Photos</li>
                                    <li>Wedding Photos</li>
                                </ul>
                            </div>
                        </div>
                    </li>
