                                        <span style="font-size: 16pt; font-family: arial, helvetica, sans-serif;">ClaimantInformation:</span>
                                    </strong>
                                </p>
                                <p>A claimant isa person or legal entity that currently ownsall or part of the copyright. An author (original creator) that does not currently own part of the copyright should not be added under claimants. Authors will be added in the author section below. While authorship is always attributed to the original creator of the copyright, the ownership, whether partial or in whole, can be sold or transferred. A claimant is the beneficiary of any monetization attributed to a copyright. A claimant is also the licensor of the copyright and has the full right to sell, license and transfer the copyright. The total percentage of all claimants must add up to 100%.</p>
