                                    <span style="font-size: 12pt; font-family: arial, helvetica, sans-serif;">A copyright author is the original creator of the copyright material and in most cases the owner of the copyright claim. There can be multiple copyright authors of a single copyright claim and while the ownership can be sold or transferred, the authorship cannot be sold or transferred and is embedded as part of the claim for the entire duration of the copyright. If the ownership was transferred from the author(s) to a separate person or entity please see the Claimant section below. The total percentage authorships must add up to 100%.</span>
