                                <p>
                                    <strong>
                                        <span style="font-size: 16pt; font-family: arial, helvetica, sans-serif;">Date of First Publication:</span>
                                    </strong>
                                </p>
                                <p>Provide the month, day, and year the work was first published in any country. If you do not know the exact date of first publication, give the approximate month, day, and year. If the work is not published yet, enter today's date.</p>
                                <p>Publication is the distribution of copies of a work to the public by sale or other transfer of ownership, or by rental, lease, or lending. The offering to distribute copies or phonorecords to a group of persons for purposes of further distribution, public performance, or public display also constitutes publication. A public performance or display of a work does not of itself constitute publication.</p>
                                <p>To help youdetermine whether the work has been published or is unpublishedconsider whether you have sold or licensed your work to be sold or distributed to the public. If you have never performed or displayed your work for monetary compensation it is considered unpublished.</p>
